import React from "react";
import styled from "styled-components";
const Container = styled.div`

  height: 50px;
  background-color: grey;
  display: flex;
  justify-content: center;
  text-align: center;
  align-items: center;
`;

const App = () => {
  return <Container>hello world</Container>;
};

export default App;
